class LandingPage extends Component {
    state = {  }
    render() { 
        return (
        <div id = "landingMain">


            <div className = "innerContainer col-lg-10 col-md-10 col-sm-11">

                <div className= "landingDescription col-lg-6 col-md-7">
                    <p id = "title">Christina Bui</p>
